import React, { useState } from "react";
import data from "./data";
import SingleQuestion from "./Question";

function App() {
  return (
    <>
      {data.map((question) => {
        return (
          <SingleQuestion
            key={question.id}
            title={question.title}
            info={question.info}
          />
        );
      })}
    </>
  );
}

export default App;
